import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import CoinMarketData from "../Api/CoinMarketData.json";

import "../components/CoinList.css";
function CoinList({ coins }) {
    const upbitCoinList = Object.keys(coins);
    const upbitimgsrc = CoinMarketData[0].imgsrc;
    const bithumbimgsrc = CoinMarketData[1].imgsrc;
    const binanceimgsrc = CoinMarketData[2].imgsrc;

    /*
        upbitCoinList.map((coinSym) => {
            if (coinSym === 'BTC') {
                console.log(coins[coinSym]);
            }
        })*/

    return (
        <div >
            <li className="coin-row" key={`coinlist-${coinSym}`}>
                <div className="coin">
                    <img src={coins[coinSym].imgsrc} />
                    <h1>{coinSym}</h1>
                </div>

                {coins[coinSym].upbitSym ? <img className="exchange-img" src={upbitimgsrc} /> :
                    <div></div>
                }
                <div className="coin-data">
                    {coins[coinSym].upbitSym ?
                        <p className="coin-price">
                            {coins[coinSym].upbitSym}
                        </p> :
                        <span>
                        </span>
                    }
                    {coins[coinSym].upbitSym ?
                        <p className="coin-price">
                            {coins[coinSym].upbitPrice}
                        </p> :
                        <span>
                        </span>
                    }
                </div>

                {coins[coinSym].upbitBTC ? <img className="exchange-img" src={upbitimgsrc} /> :
                    <div></div>
                }
                <div classame="coin-data">
                    {coins[coinSym].upbitBTC ?
                        <p className="coin-price">
                            {coins[coinSym].upbitBTC}
                        </p> :
                        <span>
                        </span>
                    }
                    {coins[coinSym].upbitBTC ?
                        <p className="coin-price">
                            {coins[coinSym].upbitBTCPrice}
                        </p> :
                        <span>

                        </span>
                    }
                </div>

                {coins[coinSym].upbitUSDT ? <img className="exchange-img" src={upbitimgsrc} /> :
                    <div></div>
                }
                <div classame="coin-data">
                    {coins[coinSym].upbitUSDT ?
                        <p className="coin-price">
                            {coins[coinSym].upbitUSDT}
                        </p> :
                        <span>
                        </span>
                    }
                    {coins[coinSym].upbitUSDT ?
                        <p className="coin-price">
                            {coins[coinSym].upbitUSDTPrice}
                        </p> :
                        <span>

                        </span>
                    }
                </div>



                {coins[coinSym].bithumbSym ? <img className="exchange-img" src={bithumbimgsrc} /> :
                    <div></div>
                }
                <div classame="coin-data">
                    {coins[coinSym].bithumbSym ?
                        <p className="coin-price">
                            {coins[coinSym].bithumbSym}
                        </p> :
                        <span>
                        </span>
                    }
                    {coins[coinSym].bithumbSym ?
                        <p className="coin-price">
                            {coins[coinSym].bithumbPrice}
                        </p> :
                        <span>

                        </span>
                    }
                </div>
                {coins[coinSym].bithumbBTC ? <img className="exchange-img" src={bithumbimgsrc} /> :
                    <div></div>
                }
                <div classame="coin-data">
                    {coins[coinSym].bithumbBTC ?
                        <p className="coin-price">
                            {coins[coinSym].bithumbBTC}
                        </p> :
                        <span>
                        </span>
                    }
                    {coins[coinSym].bithumbBTC ?
                        <p className="coin-price">
                            {coins[coinSym].bithumbBTCPrice}
                        </p> :
                        <span>

                        </span>
                    }
                </div>




                {coins[coinSym].binanBNBSym ? <img className="exchange-img" src={binanceimgsrc} /> :
                    <div></div>
                }
                <div classame="coin-data">
                    {coins[coinSym].binanBNBSym ?
                        <p className="coin-price">
                            {coins[coinSym].binanBNBSym}
                        </p> :
                        <span>
                        </span>
                    }
                    {coins[coinSym].binanBNBSym ?
                        <p className="coin-price">
                            {coins[coinSym].binanBNBPrice}
                        </p> :
                        <span>

                        </span>
                    }
                </div>
                {coins[coinSym].binanUSDTSym ? <img className="exchange-img" src={binanceimgsrc} /> :
                    <div></div>
                }
                <div classame="coin-data">
                    {coins[coinSym].binanUSDTSym ?
                        <p className="coin-price">
                            {coins[coinSym].binanUSDTSym}
                        </p> :
                        <span>
                        </span>
                    }
                    {coins[coinSym].binanUSDTSym ?
                        <p className="coin-price">
                            {coins[coinSym].binanUSDTPrice}
                        </p> :
                        <span>

                        </span>
                    }
                </div>
                {coins[coinSym].binanBTCSym ? <img className="exchange-img" src={binanceimgsrc} /> :
                    <div></div>
                }
                <div classame="coin-data">
                    {coins[coinSym].binanBTCSym ?
                        <p className="coin-price">
                            {coins[coinSym].binanBTCSym}
                        </p> :
                        <span>
                        </span>
                    }
                    {coins[coinSym].binanBTCSym ?
                        <p className="coin-price">
                            {coins[coinSym].binanBTCPrice}
                        </p> :
                        <span>

                        </span>
                    }
                </div>
            </li>


        </div>
    )
}

export default CoinList;

